    return res.status(400).json({
      error : "CONTENTS IS NOT STRING",
      code : 2
    });
  }

  if(req.body.contents === ""){
    return res.status(400).json({
      error : "EMPTY CONTENTS",
      code : 3
    });
  }

  let memo = Memo({
    writer : req.session.loginInfo.username,
    contents : req.body.contents
  });

  memo.save((err)=>{
    if(err) throw err;
    return res.json({success : true});
  });
});

