});

// DELETE MEMO
router.delete("/:id", (req, res)=>{

});

// GET MEMO LIST
router.get("/", (req, res)=>{
  console.log("/api/memo/ 호출 됨");
  Memo.find().sort({"_id" : -1}).limit(6).exec((err, memos)=> {
    if(err) throw err;
    console.log("정상 반환");
    return res.json(memos);
  });
});

